import React from 'react';
import { Typography } from '@material-ui/core'
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';

const Homepage = () => {
  return <Card>
    <CardHeader title = "Fitness Tracker" />
    <img src='https://www.muscleandfitness.com/wp-content/uploads/2018/11/Group-Fitness-Class-Performing-A-Variety-Of-Exercises-1.jpg?quality=86&strip=all' alt='banner'/>
    </Card>
}

export default Homepage;
